INSERT INTO investment_firms (id, name, description, website, stages, sectors, linkedin_url, created_at, folk_id, folk_workspace_id, folk_list_ids, folk_updated_at, source, updated_at, hq_location, industry, emails, phones, addresses, urls, folk_custom_fields, enrichment_status) VALUES ('8ab07e14-d25e-4eb8-a54f-7aeb58e62742', 'Arches Capital', 'Arches Capital is a fast-growing group of business angels that is bridging the gap between Venture Capitalist (VCs) and how angels operate today, by joining the best of both worlds for our members. Our community strives to bring superior deal flow, professional knowledge and lower risk profile to our participating angel investors. We further distinguish ourselves in the way profits are generated and shared, and how our angels interact with their investees (the startups) and with each other. For this we are building the leading platform of actively engaged business angels that know how to operate and manage their investments in a professional and standardized manner. Operate like a VC, be an Angel We source, select and invest like a VC; We engage, care and inspire as the angel we are. Arches Capital invests in early stage and scaling companies. We differentiate itself from angel syndicates or funds by supporting the next growth stage as well: we aim to lead or contribute to follow-on investments of our successful portfolio companies.', 'https://arches.capital', '[]'::jsonb, '[]'::jsonb, 'https://www.linkedin.com/company/archescapital/mycompany/verification/', '2025-12-25T18:32:15.429Z', 'com_05c9ce14-db55-46ab-99af-1826eab106b5', 'grp_b6775cbc-29e9-4e71-b742-e0498331dee8', '["grp_ae60bf78-cc82-478f-8b81-ecef406dc0dd","grp_b6775cbc-29e9-4e71-b742-e0498331dee8","grp_62ed75ea-252a-4b2f-8f23-a9da0c20983d"]'::jsonb, '2025-12-25T18:32:15.428Z', 'folk', '2025-12-25T18:32:15.429Z', 'Netherlands', 'B2B software', '[]'::jsonb, '[]'::jsonb, '[]'::jsonb, '["https://arches.capital"]'::jsonb, '{"Title":null,"Rounds":"Pre-Seed","Status":null